import React from 'react';
import { useSelector } from "react-redux";

const CharacterComponent = () => {
  const characters = useSelector((state) => state.allCharacters.characters);
  const renderList = characters.map((character) => {
  const { name, gender,born} = characters;
  return (
    <div className="four wide column">
        <div className="ui link cards">
          <div className="card">
            <div className="content">
               <div className="header">{name}</div>
                <div className="meta price">$ {gender}</div>
                 <div className="meta">{born}</div>
               </div>
            </div>
          </div>
        </div>

  );
  });
  return 
  <>{renderList}</>;
  
}

export default CharacterComponent
